import React, { Component } from "react";
import './Cart.css'
export default class Cart extends Component {
	render() {
		return (
			<div className="cart">
				{this.props.data.map((item) => (
					<div key={item.id} className="cart__data">
						<div>
							<h3>{item.name}</h3>
							<img
								src={item.image}
								alt={item.name}
								width="300px"
								height="370px"
							/>
						</div>
					
							<p>{item.rating}</p>
							<p>{item.type}</p>
						
					</div>
				))}
			</div>
		);
	}
}
